␀,"ban_action":"BAN","preferred_body":{"__typename":"TextWithEntities","translation_type":"ORIGINAL","delight_ranges":[],"image_ranges":[],"inline_style_ranges":[],"aggregated_ranges":[],"ranges":[],"color_ranges":[],"text":"198 is the park not the forest \n\nFoothill trails around Potwisha and hospital rock search the group or check all trails it\u2019s been commented a few times. These are out of the snow. In the snow giant forest, Wolverton, lodgepole.\n\nYou will not be able to pass through sequoia to kings canyon you will have to go around  via 245 or 63. \n\nKings canyon is deceiving because the canyon itself is not accessible to vehicles in the winter. There is a sequoia grove at grants grove that is an easy accessible hike. Panoramic point, Hume lake, Chicago stump\/cherry gap. \n\nAgain AllTrails is your friend and consider these locations are at elevation and will have snow."}

␀,"ban_action":"BAN","preferred_body":{"__typename":"TextWithEntities","translation_type":"ORIGINAL","delight_ranges":[],"image_ranges":[],"inline_style_ranges":[],"aggregated_ranges":[],"ranges":[],"color_ranges":[],"text":"198 is the park not the forest \n\nFoothill trails around Potwisha and hospital rock search the group or check all trails it\u2019s been commented a few times. These are out of the snow. In the snow giant forest, Wolverton, lodgepole.\n\nYou will not be able to pass through sequoia to kings canyon you will have to go around  via 245 or 63. \n\nKings canyon is deceiving because the canyon itself is not accessible to vehicles in the winter. There is a sequoia grove at grants grove that is an easy accessible hike. Panoramic point, Hume lake, Chicago stump\/cherry gap. \n\nAgain AllTrails is your friend and consider these locations are at elevation and will have snow."}

␀,"ban_action":"BAN","preferred_body":{"__typename":"TextWithEntities","translation_type":"ORIGINAL","delight_ranges":[],"image_ranges":[],"inline_style_ranges":[],"aggregated_ranges":[],"ranges":[],"color_ranges":[],"text":"Update- I headed toward the park, and saw the sign that chains would be required around where \u201cTotem\u201d market is. When heading in, you\u2019ll pass chevron gas station on the left and a few miles closer to the entrance, you\u2019ll hit Totem on the right. I pulled in to Totem, the guys were friendly enough, but not super helpful. They were telling folks ahead of me to \u201ctake the cables (that\u2019s what they offered) and see if they fit, if you don\u2019t know how to put them on, watch the video on the tv.\u201d Now- If you\u2019ve never done it, it can seem daunting.  It was busy and a seemed like controlled chaos.  And they are very expensive here.  Ultimately, they didn\u2019t have the size I needed, so they recommended Chevron. I drove back to Chevron-and rented the cables for about 1\/2 the price of Totem. Both of these places require hefty deposits- Chevron required $150 cash deposit for the size I needed....smaller were $100.  I think Totem was about the same.  Lobo at the Chevron station showed me how to put the cables on, (front only) had me do a tire, then my 13 y\/o son do the other. So nice he was!  (but I\u2019m a nice person too- I\u2019m not an ass to people- and we struck up easy conversation amid my lesson.) Anyhoo- we were asked at the entrance if we had chains.  So be ready  for that. When it came to the point where Rangers told us to pull over,  we had our cables on in under 2 minutes a tire. Many folks had NO idea how to do it on their vehicles-(from Totem), so my son and I helped about 4 vehicles. It\u2019s not hard- but being shown how made all the difference! Go Chevron! \nAnd yes, they were needed! It was a spectacular day today- couldn\u2019t imagine needing chains- but going up to General Sherman there were some dicey spots. \nThanks everybody for the info."}
